import React from 'react'
import CounterOutput from './CounterOutput'
import CounterControl from './CounterControl'

class Counter extends React.Component {
    state = {
        counter: 0
    }

    render() {
        return (
            <div>
                <CounterControl
                    lable="Inc"
                    clicked={() => this.counterChangeHandler('inc')}
                />
            </div>
        )
    }
}

export default Counter;
